import './header.css';

export default function Header() {
	return(
		<header>
			<div>
				<h3 class="timing">Jul 19 . 3 min read</h3>
				<h1>How to become MICROSOFT LEARN STUDENT AMBASSADOR-Everything you need to know!</h1>
				<div id="exception">
					<div class="author-name">
						<h3>by&nbsp<a href="">Riya Rajput</a></h3>
					</div>
					<div class="author-img"><img src="Assets\Images\author.jpg"/></div>
				</div>
				<div class="header-img">
					<img src="Assets\Images\blog.jpg"/>
				</div>
			</div>
		</header>
	);
}
